import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import HomePage from './pages/HomePage';
import ServicesPage from './pages/ServicesPage';
import RealEstatePage from './pages/RealEstatePage';
import MedicalVacationPage from './pages/MedicalVacationPage'; // Import the MedicalVacationPage component
import BusinessSolutionsPage from './pages/BusinessSolutionsPage'; // Import the BusinessSolutionsPage component
import AboutPage from './pages/AboutPage'; // Import the AboutPage component
import ContactPage from './pages/ContactPage'; // Import the ContactPage component
import './styles/global.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/services" element={<ServicesPage />} />
          <Route path="/real-estate" element={<RealEstatePage />} />
          <Route path="/medical-vacation" element={<MedicalVacationPage />} /> {/* Ensure this matches your component */}
          <Route path="/business-solutions" element={<BusinessSolutionsPage />} /> {/* Ensure this matches your component */}
          <Route path="/about-us" element={<AboutPage />} /> {/* Ensure this matches your component */}
          <Route path="/contact" element={<ContactPage />} /> {/* Ensure this matches your component */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
